import React from "react";
// import './Profile.css'

const ProfilePage
 = (props) => {
  return <div className="profile-parent">
  <h2>Welcome</h2>
  <p>First Name: {props.formData.firstName}</p>
  <p>Last Name: {props.formData.lastName}</p>
  <p>Email: {props.formData.email}</p>

</div>;
};

export default ProfilePage
;
